import React, { useState, useEffect } from "react";
import style from "./nav.module.css";

import Summary from "../tabs/summary/Summary";
import Business from "../tabs/business/Business";
import Data from "../tabs/data/Data";
import Status from "../tabs/status/Status";
import Online from "../tabs/online/Online";
import Networks from "../tabs/networks/Networks";




function Nav() {
  const [actualTab, setTab] = useState("summary");
  const [actualContent, setContent] = useState(<Summary />);

  useEffect(() => {
    switch (actualTab) {
      case "business":
        setContent(<Business />);
        break;
      case "data":
        setContent(<Data />);
        break;
      case "status":
        setContent(<Status />);
        break;
      case "online":
        setContent(<Online />);
        break;
      case "networks":
        setContent(<Networks />);
        break;
      default:
        setContent(<Summary />);
        break;
    }
  }, [actualTab]);

  return (
    <div>
      <nav>
        <ul className={style.navList}>
          {" "}
          <li onClick={() => setTab("summary")}>סיכום</li>
          <li onClick={() => setTab("business")}>עסקי</li>
          <li onClick={() => setTab("data")}>מאגרי מידע</li>
          <li onClick={() => setTab("status")}>סטטוס משפטי</li>
          <li onClick={() => setTab("online")}>אזכורים ברשת</li>
          <li onClick={() => setTab("networks")}>רשתות חברתיות</li>
          <li onClick={() => setTab("download")}>
            <DownloadIcon />
          </li>
        </ul>
      </nav>
      <div>{actualContent}</div>
    </div>
  );
}

export default Nav;
